// import logo from "./logo.svg";
import "./App.css";
import BabyNamesData from "./babyNamesData.json";
import Search from "./Search";
import ShowNames from "./ShowNames";

function App() {
  return (
    <>
      <Search names={BabyNamesData} />
      <ShowNames names={BabyNamesData} />
    </>
  );
}

export default App;
